I'm unsure if we should add packages other than the official Spotify app. The patch is targeting Spotify. If we add xManager, then we would need to edit the code everytime we want to support another mod specifically. 
Instead, one could patch a spotify app using the change package name patch to change it back to the original one, then apply the patches they want along side the change package name patch again to change it back to what it was before.
@LisoUseInAIKyrios What do you say.
